import bz2
import binascii
import json
import argparse

class CanTemplate(object):
	"""
		docstring for CanTemplate
		signals : {name : (bitstart, bitlen, is_big_endian)}
	"""
	def __init__(self, signals, name=None):
		super().__init__()
		self.name = name
		self.signals = {sig['N'] : (sig['SB'], sig['BL'], sig['BE']) for sig in signals}
	def get_val(self, signame, can):
		signal = self.signals[signame]
		val = can[1]
		val = val >> signal[0]
		return val & ((2 ** signal[1]) - 1)
	def compare(self, can1, can2, signals=None):
		if signals is None:
			signals = self.signals.keys()
		if can1[0] != can2[0]:
			return False
		for name in signals:
			if self.get_val(name, can1) != self.get_val(name, can2):
				return False
		return True
	# exclude zeroes
	def split_to_signals(self, can):
		for name in self.signals.keys():
			val = self.get_val(can, name)
			if val != 0:
				yield (name, val)
	def keys(self):
		return self.signals.keys()

class CANBase(object):
	"""
		format of zipped data:
		{mess_id : {'N' : name, 'S': signals}}
			where 
				signals = [{'N' : name, 'SB' : start big, 'BL' : bit len, 'BE' : is big endian, 'O' : offset}]
	"""
	zip_base = {
			"Atlantis" : {
 				"BHCAN": b'',
 				"C1CAN": b'',
			},
			"CUSW" : {
 				"BHCAN": b'',
 				"CCAN": b'',
			},
			"PNET" : {
 				"BHCAN": b'',
 				"CCAN": b'',
			},
		}

	@classmethod
	def arch(cls, archname):
		acc = []
		for can in cls.zip_base[archname].keys():
			acc.append(cls(archname, can))
		return acc
	def __init__(self, architect, cantype):
		super().__init__()
		self.architect = architect
		self.can = cantype
		orig = self.__class__.zip_base[architect][cantype]
		self.by_id = {}
		self.name_to_id = {}
		js = json.loads(bz2.decompress(binascii.unhexlify(orig)))
		for key,val in js.items():
			key = int(key)
			name = val['N']
			self.by_id[key] = CanTemplate(val['S'], name)
			self.name_to_id[name] = key
	def get_name(self, name):
		return self.by_id[self.name_to_id[name]]
	def get_id(self, id):
		return self.by_id[id]
	def all_id(self):
		return self.by_id.keys()
	def all_names():
		return self.name_to_id.keys()

class Utils(object):
	def __init__(self, arch):
		self.bases = CANBase.arch(arch)
	def print_val(self, mess):
		found = False
		for base in self.bases:
			try:
				templ = base.get_id(mess[0])
				print('IN BASE %s FOUND' % (base.can, templ.name) )
				for name in templ.signals.keys():
					print('\t%s = %s' % (name, templ.get_val(name, mess)))
				found = True
			except KeyError:
				continue
		if not found:
			print('NOT FOUND')

def read_can(text):
	split = text.split(' ')
	key = int(split[0], 16)
	split = split[1:]
	split.reverse()
	val = int(''.join(split), 16)
	return (key,val)

